import React, {Component} from 'react'
import {Link} from "react-scroll"
import MainPage from "./MainPage"
import Education from "./Education"
import Skill from "./Skills"

import "./style.css"
class App extends Component{


        render(){
            return(
                <div >
                    <ul className = "navbar">
                        <Link 
                            activeClass = "active"
                            to = "mainpage"
                            spy = {true}
                            smooth = {true}
                            offset = {-70}
                            duration={500}>
                            Main Page
                        </Link>

                        <Link 
                            activeClass = "active"
                            to = "skills"
                            spy = {true}
                            smooth = {true}
                            offset = {-70}
                            duration={500}>
                            Skills
                        </Link>

                        <Link 
                            activeClass = "active"
                            to = "education"
                            spy = {true}
                            smooth = {true}
                            offset = {-70}
                            duration={700}>
                            Education
                        </Link>
                    </ul>

                    <div>
                        <MainPage/>
                        <Skills/>
                        <Education/>   
                    </div>

                </div>



                )
            }
        }
